// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract SellNFTs is ReentrancyGuard{   
    using Counters for Counters.Counter;
    Counters.Counter private _ItemIds;
    Counters.Counter private _ItemSold;

    // owner of contract
    address payable owner;
    // commison amount to creater of item
    uint256 listingPrice = 0.025 ether;

    // owner of this contract who is deploying this
    constructor() {
        owner = payable(msg.sender);
    }

    struct MarketItem {
        uint ItemId;
        address nftContract;
        uint256 tokenId;
        address payable seller;
        address payable owner;
        uint256 price;
        bool sold;
    }
    // fetch market item using its id
    mapping(uint256 => MarketItem) private idToMarketItem;

    // having event when market item created
    // this event going to match maketItem preety well
    event MarketItemCreated (
        uint indexed ItemId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address  seller,
        address  owner,
        uint256 price,
        bool sold
    );

    // return listing price
    function getListingPrice() public view returns (uint256) {
        return listingPrice;
    }
    
    // putting item on sell
    // nonReentrant modifier prevents nonreentrant attack
    function createMarketItem(address nftContract, uint256 tokenId, uint256 price) public payable nonReentrant {
        require(price >0, "Price must be at least 1 wei");
        // persion is sending listingPrice along with the transaction
        require(msg.value == listingPrice, "Price must be equal to listing price");

        _ItemIds.increment();
        uint256 ItemId = _ItemIds.current();
        
        // creating market item
        idToMarketItem[ItemId] = MarketItem(
            ItemId,
            nftContract,
            tokenId,
            payable(msg.sender),
            // address(0) empty address
            payable(address(this)),
            price,
            false
        );

        // transfer owner of this contract to it self
        IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);

        // emit market item
        emit MarketItemCreated(
            ItemId,
            nftContract,
            tokenId,
            msg.sender,
            address(this),
            price,
            false
        );
    }

    // selling item to seller
    function createMarketSale(address nftContract, uint256 itemId) public payable nonReentrant{
        uint price = idToMarketItem[itemId].price;
        uint tokenId = idToMarketItem[itemId].tokenId;

        // check sending price is equal to item price 
        require(msg.value == price, "Price submit the asking price in order to complete the purchases");

        // transnfer the value of the transaction to the seller
        idToMarketItem[itemId].seller.transfer(msg.value);
        
        // transfer owner of this contract to buyer
        IERC721(nftContract).transferFrom(address(this), msg.sender, tokenId);

        idToMarketItem[itemId].sold = true;
        _ItemSold.increment();

        // tranfering the amount that person had listed item for to the contract owner
        payable(owner).transfer(listingPrice);

    }

    // fetch all unsold NFTs
    function fetchMarketItem() public view returns (MarketItem[] memory){
        uint itemCount = _ItemIds.current();
        uint unsoldItemCount = _ItemIds.current() - _ItemSold.current();

        uint currentIndex = 0;

        // create an empty array
        MarketItem[] memory items = new MarketItem[](unsoldItemCount);
        for(uint i = 0; i < itemCount; i++){
            // if this item is unsold
            if(idToMarketItem[i + 1].owner == address(0)) {
                uint currentId = idToMarketItem[i + 1].ItemId;
                MarketItem storage currentItem = idToMarketItem[currentId];
                // storing item in this index
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        // return total unsold item
        return items;
    }

    // fetch all my items(NFTs)
    function fetchMyNFTs() public view returns (MarketItem[] memory){
        uint totalItemCount = _ItemIds.current();
        // count my total item
        uint itemcount = 0;
        uint currentIndex = 0;

        for(uint i = 0; i < totalItemCount; i++){
            // if this item's owner is current address
            if(idToMarketItem[i + 1].owner == msg.sender) {
                itemcount += 1;
            }
        }

        // create an empty array
        MarketItem[] memory items = new MarketItem[](itemcount);
        for(uint i = 0; i < totalItemCount; i++){
            // if this item's owner is current address
            if(idToMarketItem[i + 1].owner == msg.sender) {
                uint currentId = idToMarketItem[i + 1].ItemId;
                MarketItem storage currentItem = idToMarketItem[currentId];
                // storing item in this index
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;

    }

    // return items which is created by this user
    function fetchItemCreated() public view returns (MarketItem[] memory){
        uint totalItemCount = _ItemIds.current();
        uint itemcount = 0;
        uint currentIndex = 0;

        for(uint i = 0; i < totalItemCount; i++){
            // if this item's seleer os current address
            if(idToMarketItem[i + 1].seller == msg.sender) {
                itemcount += 1;
            }
        }

        // create an empty array
        MarketItem[] memory items = new MarketItem[](itemcount);
        for(uint i = 0; i < totalItemCount; i++){
            // if this item's seleer os current address
            if(idToMarketItem[i + 1].seller == msg.sender) {
                uint currentId = idToMarketItem[i + 1].ItemId;
                MarketItem storage currentItem = idToMarketItem[currentId];
                // storing item in this index
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;
    }

}
